import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./pages/Auth/Login";
import DashboardFamiliar from "./pages/Familiar/DashboardFamiliar";
import DashboardIdoso from "./pages/Idoso/DashboardIdoso";
import DashboardAdmin from "./pages/Admin/DashboardAdmin";

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Login />} />

                {/* Dashboards */}
                <Route path="/familiar/dashboard" element={<DashboardFamiliar />} />
                <Route path="/idoso/dashboard" element={<DashboardIdoso />} />
                <Route path="/admin/dashboard" element={<DashboardAdmin />} />
            </Routes>
        </Router>
    );
}

export default App;
